import React from 'react';
import './BikeModels.css';  // Import the CSS specific for this page

const bikeModels = [
  { name: 'Bike Model 1', description: 'Description for Bike Model 1', image: 'bike1.jpg' },
  { name: 'Bike Model 2', description: 'Description for Bike Model 2', image: 'bike2.jpg' },
  { name: 'Bike Model 3', description: 'Description for Bike Model 3', image: 'bike3.jpg' },
  { name: 'Bike Model 4', description: 'Description for Bike Model 4', image: 'bike4.jpg' },
  { name: 'Bike Model 5', description: 'Description for Bike Model 5', image: 'bike5.jpg' },
];

const BikeModels = () => {
  return (
    <div className="bike-models-page">
      <h2>Bike Models</h2>
      <div className="bike-models-list">
        {bikeModels.map((bike, index) => (
          <div key={index} className="bike-model">
            <img src={`../images/${bike.image}`} alt={bike.name} className="bike-model-image" />
            <h3>{bike.name}</h3>
            <p>{bike.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default BikeModels;
